```c++
#include <iostream>
#include <fstream>
#include <string>

using namespace std;

int main() {
    string filename;
    string word;
    int count = 0;

    cout << "Enter the filename: ";
    cin >> filename;

    cout << "Enter the word to search for: ";
    cin >> word;

    ifstream file(filename);

    if (file.is_open()) {
        string line;
        while (getline(file, line)) {
            if (line.find(word) != string::npos) {
                count++;
            }
        }
        file.close();
        cout << "Number of occurrences of " << word << " in " << filename << ": " << count << endl;
    } else {
        cout << "Error opening file " << filename << endl;
    }

    return 0;
}
```
